import { View, Text, ScrollView, StyleSheet } from 'react-native'
import React from 'react'

const StatsScreen = () => {
  return (
    <View>
          <Text>StatsScreen</Text>
          <ScrollView horizontal={true}>
              <View style={styles.infoBlock}>
                  <Text style={styles.infoBlockTxtTop}>
                      Something
                  </Text>
                 View <Text style={styles.infoBlockTxtBottom}>
                      Stat
                  </Text>
              </View>
          </ScrollView>
    </View>
  )
}

export default StatsScreen

const styles = StyleSheet.create({
  infoBlock: {
    backgroundColor: "rgba(239,239,239,1)",
    borderRadius: 20,
    width: 266,
    height: 111,
  },
  infoBlockTxtTop: {
    color: "rgba(155,155,155,1)",
    fontSize: 25,
    fontWeight: "600",
  },
  infoBlockTxtBottom: {
    color: "rgba(0,0,0,1)",
    fontSize: 30,
    fontWeight: "600",
  },
});
